import React, { Component } from 'react';
import './App.css';
import NavBar from './NavBar/NavBar';
import TitleComponent from './TitleComponent/TitleComponent';

class App extends Component {
  render() {
    return (
      <div className="App">

          <NavBar />

          <TitleComponent />

      </div>
    )
  }
}

export default App;
